import React from 'react';
import classes from './Layout.css';
import Aux from '../../Hoc/Aux';
import Toolbar from '../Navigation/Toolbar/Toolbar';

const layout = (props) => {
    return (
        <Aux>
        <Toolbar />
        <main className={classes.Contents}>
            {props.children}
        </main>
        </Aux>
    );
}

export default layout;
